-- ----------------------------
-- Table structure for book
-- ----------------------------
DROP TABLE IF EXISTS `book`;
CREATE TABLE `book` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(45) DEFAULT NULL,
  `author` varchar(45) DEFAULT NULL,
  `description` text,
  `copies` int(11) DEFAULT NULL,
  `copies_available` int(11) DEFAULT NULL,
  `category` varchar(11) DEFAULT NULL,
  `img` mediumblob,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of book
-- ----------------------------
BEGIN;
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (1, 'Jane Eyre', 'Charlotte Brontë', 'The story of Jane Eyre follows the life of an orphaned girl, Jane, from childhood to adulthood. Jane loses her parents at a young age and is taken in by an unkind aunt who eventually sends her to a strict charity school. Despite facing hardships, Jane develops a resilient and independent spirit. As an adult, she secures a position as a governess at Thornfield Hall, where she meets and falls in love with the estate’s master, Mr. Rochester.\n\nHowever, Jane discovers that Rochester is hiding a dark secret: he has a wife who is mentally ill and locked away in the attic. Devastated, Jane chooses to leave him, embracing her independence and moral integrity. After a period of self-discovery and hardship, she eventually reunites with Mr. Rochester, and they find true companionship after many trials.', 6, 5, 'FIC', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (2, 'Wuthering Heights', 'Emily Brontë', 'The story is set on the desolate moors of Yorkshire and revolves around two families, the Earnshaws and the Lintons, and the complex relationships between their members. The central focus is on Heathcliff, an orphan adopted by Mr. Earnshaw, who develops an obsessive and all-consuming love for his childhood friend, Catherine Earnshaw. However, Catherine chooses to marry Edgar Linton, a neighbor from a wealthier family, due to social status concerns, leaving Heathcliff heartbroken and vengeful.\n\nHeathcliff’s love for Catherine turns into a destructive obsession, leading him to seek revenge on those who have wronged him, including the Earnshaw and Linton families. He ultimately marries Edgar’s sister, Isabella, only to further his schemes. After Catherine’s untimely death, Heathcliff’s desire for revenge and possession of Wuthering Heights and Thrushcross Grange (the Linton estate) consumes him until his own death. The novel ends on a note of redemption as Catherine’s daughter, young Catherine, and Heathcliff’s son, Hareton, overcome the cycle of vengeance and find peace together.', 6, 6, 'FIC', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (3, 'The Murder of Roger Ackroyd', 'Agatha Christie', 'The story takes place in the quiet English village of King’s Abbot. The protagonist and narrator, Dr. James Sheppard, is a local physician who becomes involved in a murder investigation when his friend, the wealthy Roger Ackroyd, is found dead. Ackroyd was last seen in his study, where he was about to reveal the name of a blackmailer who had driven his fiancée, Mrs. Ferrars, to suicide.\nFamous Belgian detective Hercule Poirot, who has retired to the village, is called in to solve the case. With his sharp intellect and unique approach, Poirot begins questioning the townspeople, uncovering hidden secrets, motives, and lies among Ackroyd’s family and acquaintances. Suspicion shifts from one character to another as Poirot pieces together clues.\nThe novel reaches its climax with one of the most shocking endings in detective fiction: Poirot reveals that Dr. Sheppard, the story’s narrator, is the murderer. Sheppard had been hiding his guilt while narrating the story, manipulating the reader’s perception. This twist ending was groundbreaking for its time and demonstrated Christie’s skill in playing with narrative structure and perspective.', 12, 11, 'FIC', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (4, 'The A.B.C. Murders', 'Agatha Christie', 'The story begins when Poirot receives an anonymous letter challenging him to prevent a murder, signed by “A.B.C.” Soon after, a woman named Alice Ascher is killed in Andover, followed by Betty Barnard in Bexhill, and then Sir Carmichael Clarke in Churston—all in alphabetical order, with each crime scene leaving behind an A.B.C. railway guide. The pattern suggests a chilling series of murders with a calculated killer targeting victims based on their initials and location.\n\nPoirot, with his friend Captain Hastings, begins a race against time to prevent further murders. As the killer continues leaving clues, Poirot delves into the psychology behind the murders, looking beyond the apparent randomness for underlying motives. Poirot suspects that the pattern may be a diversion, and that the murders aren’t as straightforward as they appear.\n\nThe story culminates in a twist when Poirot reveals that the alphabetic murders were orchestrated to disguise a personal vendetta. The real motive was to eliminate a single specific victim (Sir Carmichael Clarke) while making it appear as part of a larger, random pattern to evade suspicion. The seemingly “alphabet-driven” killer, Alexander Bonaparte Cust, was manipulated to believe he was responsible for the crimes, making him an unknowing accomplice rather than the mastermind.', 6, 6, 'FIC', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (5, 'Pride and Prejudice', 'Jane Austen', 'The story revolves around Elizabeth Bennet, one of five daughters in a middle-class family. The Bennet family’s primary concern is the marriage prospects of the daughters, as they have no wealth or inheritance to secure their future. The arrival of the wealthy and charming Mr. Charles Bingley, along with his friend Mr. Fitzwilliam Darcy, sparks excitement and sets the stage for romantic entanglements. While Mr. Bingley quickly develops feelings for Elizabeth’s elder sister, Jane, Elizabeth finds herself at odds with Mr. Darcy, who initially seems arrogant and dismissive.\n\nAs the story unfolds, Elizabeth learns more about Mr. Darcy’s true character, uncovering his loyalty, integrity, and a deep sense of responsibility. Mr. Darcy, in turn, overcomes his initial pride and prejudice toward Elizabeth’s family and social status, recognizing her wit, strength, and intelligence. The novel follows the two as they confront their own biases and misunderstandings, ultimately finding mutual respect and love.', 11, 11, 'FIC', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (6, 'War and Peace', 'Leo Tolstoy', 'The novel follows the lives of four aristocratic families—the Bolkonskys, the Bezukhovs, the Rostovs, and the Kuragins—intertwined with the historical events of the French invasion of Russia. Through a vast array of characters, Tolstoy examines how war affects individuals and society as a whole. The novel’s key figures include Prince Andrei Bolkonsky, Pierre Bezukhov, and Natasha Rostova, each of whom undergoes significant personal development and philosophical questioning amidst the chaos of war.', 7, 7, 'FIC', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (7, 'Les Misérables', 'Victor Hugo', 'The novel is set in France and spans several decades, focusing on the lives of multiple characters, each representing different aspects of society. The central story follows Jean Valjean, a former convict who struggles to redeem himself and create a better life. Along the way, he crosses paths with a variety of characters, some of whom embody virtues such as compassion and self-sacrifice, while others represent the harsh realities of the law and social injustice.', 13, 13, 'FIC', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (8, 'The Republic', 'Plato', 'The dialogue is set in the form of a conversation led by Socrates, who engages various characters in discussion about the nature of justice. The main theme revolves around the concept of the ideal city-state and how individuals within it should live to achieve a just and harmonious society.\n\nPlato outlines a utopian vision of society, where justice is achieved when each individual performs the role for which they are best suited, and the society is governed by philosopher-kings. These rulers, he argues, should be educated and trained in philosophy, so they understand the “Forms”—abstract, perfect ideals that represent the highest and most fundamental reality.', 16, 16, 'NF', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (9, 'Steve Jobs', 'Walter Isaacson', 'This book follows the life and career of Steve Jobs, detailing his childhood, the founding of Apple, his time away from the company, and his return to revolutionize the tech world. The biography provides insight into both his personal life and professional achievements, giving readers a comprehensive understanding of one of the most influential figures in modern technology.', 8, 8, 'NF', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (10, 'Romeo and Juliet', 'William Shakespeare', 'In the city of Verona, two noble families, the Montagues and the Capulets, have been feuding for years. Romeo Montague, a young man from the Montague family, sneaks into a Capulet party where he meets and falls in love with Juliet Capulet, a young woman. They quickly discover their families are enemies, but their love for each other is deep and immediate.\n\nDespite the feud, Romeo and Juliet secretly marry the next day, hoping their union will help end the conflict. However, Romeo kills Tybalt, Juliet’s cousin, in a duel after Tybalt kills his friend Mercutio. As a result, Romeo is banished from Verona.\n\nDesperate to be together, Juliet seeks the help of Friar Laurence, who gives her a potion that will make her appear dead for 42 hours. She plans to be buried in the Capulet tomb and then escape with Romeo. However, the message explaining this plan never reaches Romeo. Believing Juliet is truly dead, Romeo returns to Verona, buys poison, and goes to her tomb.\n\nThere, he encounters and kills Paris, who was mourning Juliet. Romeo then takes the poison and dies beside her. When Juliet awakens and finds Romeo dead, she stabs herself with his dagger in grief. The deaths of Romeo and Juliet finally bring peace between the feuding families.\n', 2, 1, 'DR', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (11, 'Hamlet', 'William Shakespeare', '“Hamlet” is a tragedy by William Shakespeare that centers around Prince Hamlet of Denmark, who seeks revenge for his father’s murder. The ghost of Hamlet’s father reveals that he was murdered by Hamlet’s uncle, Claudius, who has since taken the throne and married Hamlet’s mother, Gertrude.\n\nHamlet pretends to be mad as part of his plan to avenge his father. He kills Polonius (the royal counselor), which leads to further tragedy. Hamlet is eventually confronted by Laertes, Polonius’s son, who seeks revenge for his father’s death. In a final duel, Hamlet is mortally wounded, as is Laertes, and his mother dies from poisoning. Before he dies, Hamlet kills Claudius, avenging his father’s death.\n\nThe play explores themes of revenge, madness, and mortality, and is famous for Hamlet’s soliloquy “To be, or not to be.”', 3, 3, 'DR', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `copies`, `copies_available`, `category`, `img`) VALUES (12, 'Sherlock Holmes', 'Sir Arthur Conan Doyle', 'Sherlock Holmes is a fictional detective created by Sir Arthur Conan Doyle. Known for his sharp intellect and exceptional powers of observation, Holmes solves complex crimes using logical reasoning and forensic science. He first appeared in A Study in Scarlet (1887) and featured in four novels and fifty-six short stories.\n\nHolmes is assisted by his loyal friend and narrator, Dr. John Watson, a medical doctor. Together, they tackle a variety of mysteries, with famous cases such as The Hound of the Baskervilles and The Adventure of the Speckled Band. Holmes’s greatest adversary is Professor Moriarty, a criminal mastermind.\n\nThe stories explore themes like reason versus emotion, justice, and morality, and Holmes’s analytical methods have made him one of the most famous and enduring characters in detective fiction.', 12, 12, 'FIC', );
COMMIT;

